function collateralTable(data, columns) {
    return {
        table: {
            headerRows: 1,
            widths: ['auto', 'auto', 'auto', 'auto', 'auto', 'auto', 'auto', 'auto', 'auto', 'auto'],
            height: 30,
            body: buildTableBody(data, columns)
        }
    };
};

function buildTableBody(data, columns) {
    console.log(data);
    console.log(columns);
    console.log(columns[0]);
    if (columns[0] === 'srNo') {
        const actualColumnHead = [
            { text: 'Sr No', style: 'tableHeader' },
            { text: 'Ornament Type', style: 'tableHeader' },
            { text: '#Items', style: 'tableHeader' },
            { text: 'Day Rate (Rs)', style: 'tableHeader' },
            { text: 'Gross Weight (gm)', style: 'tableHeader' },
            { text: 'Deductions (gm)', style: 'tableHeader' },
            { text: 'Net Weight (gm)', style: 'tableHeader' },
            { text: 'Carat', style: 'tableHeader' },
            { text: 'Rate/gm (Rs)', style: 'tableHeader' },
            { text: 'Valuation (Rs)', style: 'tableHeader' }
        ];
        var columnsMd = columns;
        columnsMd = actualColumnHead.slice(0);
        console.log(columnsMd);
    }

    const body = [];
    body.push(columnsMd);
    console.log(`columnsMd ::::${columnsMd}`);
    data.forEach(function (row) {
        const dataRow = [];
        console.log('1', row);
        columns.forEach(function (column) {
            console.log('2', columns);
            console.log('3', column);
            console.log('4', row[column]);
            dataRow.push(row[column].toString());
        });

        console.log(dataRow);
        body.push(dataRow);
    });
    return body;
};

