function buildImgTableBody(data, columns) {
    console.log(data);
    console.log(columns);
    console.log(columns[0]);
    if (columns[0] === 'srNo') {
        const actualColumnHead = [
            { text: 'Sr No', style: 'tableHeader' },
            { text: 'Ornament Type', style: 'tableHeader' },
            { text: 'Image', style: 'tableHeader' },
        ];
        var columnsMd = columns;
        columnsMd = actualColumnHead.slice(0);
        console.log(columnsMd);
    }

    const body = [];
    body.push([{ text: 'Collateral Images:', style: 'tableHeader', colSpan: 3 }, {}, {}])
    body.push(columnsMd);
    console.log(`columnsMd ::::,${columnsMd}`);
    data.forEach(function (row) {
        const dataRow = [];
        console.log('1', row);
        columns.forEach(function (column) {
            console.log('2', columns);
            console.log('3', column);
            console.log('4', row[column]);
            if (column === 'imageId') {
                dataRow.push({ image: glvFinal.images[row[column]], height: 175, width: 175 });
            } else {
                dataRow.push({ text: row[column].toString() });
            }
        });

        console.log(dataRow);
        body.push(dataRow);
    });
    return body;
};

